"6435":{"id":"6435","name":"Da Magia à Sedução","slug":"da-magia-a-seducao","original_title":"Practical Magic","overview":"As mulheres da família Owens tem poderes mágicos. Mas uma maldição as persegue há mais de duzentos anos: qualquer homem que se apaixona por uma delas, morre. Descendentes da bruxa que começou este feitiço, Sally (Sandra Bullock) e Gillian (Nicole Kidman) são duas irmãs que foram criadas por suas tias (Dianne Wiest e Stockard Channing). Já adultas, enquanto Sally se mostra bastante reservada, Gillian foge de casa para ter o primeiro de muitos namorados. Após algum tempo, Sally se casa e tem duas filhas, mas seu marido acaba morrendo atropelado. Até que chega o momento em que ela deve ajudar Gillian, que se envolveu com Jimmy Angelov (Goran Visnjic), um búlgaro agressivo que as ameaça. Sentindo que correm perigo, as duas o envenenam, mas, temendo as conseqüências de tal ato, Gillian convence Sally que o melhor é trazê-lo de volta a vida. Uma decisão que trará uma série de complicações com polícia e com seus próprios poderes.","first_air_date":"1998-10-16","runtime":104,"episode_run_time":[104],"vote_average":6.8,"created_by":["Di Novi Pictures","Fortis Films"],"production_companies":[{"name":"Di Novi Pictures"},{"name":"Fortis Films"}],"cast":["Sandra Bullock","Nicole Kidman","Stockard Channing","Dianne Wiest","Goran Višnjić"],"backdrop_path":"https://image.tmdb.org/t/p/original/4kbkq887XNT85d6nJonCnmXDWor.jpg","poster_path":"https://image.tmdb.org/t/p/original/A8sD1vfkDOPLhIpNU9dqtpx4AZc.jpg","certification":"12","genres":["Romance","Comédia","Fantasia"],"trailer":"N/A"},
"389015":{"id":"389015","name":"Eu, Tonya","slug":"eu-tonya","original_title":"I, Tonya","overview":"Desde muito pequena exibindo talento para patinação artística no gelo, Tonya Harding cresce se destacando no esporte e aguentando maus-tratos e humilhações por parte da agressiva mãe. Entre altos e baixos na carreira e idas e vindas num relacionamento abusivo com Jeff Gillooly, a atleta acaba envolvida num plano bizarro durante a preparação para os Jogos Olímpicos de Inverno de 1994.","first_air_date":"2017-12-08","runtime":121,"episode_run_time":[121],"vote_average":7.5,"created_by":["LuckyChap Entertainment","Clubhouse Pictures"],"production_companies":[{"name":"LuckyChap Entertainment"},{"name":"Clubhouse Pictures"}],"cast":["Margot Robbie","Sebastian Stan","Allison Janney","Julianne Nicholson","Paul Walter Hauser"],"backdrop_path":"https://image.tmdb.org/t/p/original/jK3EAFk3GdOaQfUDCOiTujzMpwH.jpg","poster_path":"https://image.tmdb.org/t/p/original/1awJ19hydmplGNib38L8solMBHY.jpg","certification":"14","genres":["Drama","Comédia"],"trailer":"N/A"},
"8859":{"id":"8859","name":"Cara, Cadê Meu Carro?","slug":"cara-cade-meu-carro","original_title":"Dude, Where's My Car?","overview":"Conheça Jesse e Chester, dois garotos totalmente imaturos que acordam um dia com uma intrigante pergunta: Cara, Cadê Meu Carro? A única pista que eles têm é uma caixa de fósforos do clube de striptease Kitty Kat e um estoque de pudim para um ano. À medida que tentam percorrer os passos da noite anterior, esses caras passam pela aventura de suas vidas, encontrando sexy garotas alienígenas, escapando de avestruzes assassinas e tentando conseguir \"favores especiais\" de suas enfurecidas namoradas gêmeas.","first_air_date":"2000-12-15","runtime":83,"episode_run_time":[83],"vote_average":5.5,"created_by":["20th Century Fox","Wayne Rice/Gil Netter Productions","Alcon Entertainment"],"production_companies":[{"name":"20th Century Fox"},{"name":"Wayne Rice/Gil Netter Productions"},{"name":"Alcon Entertainment"}],"cast":["Ashton Kutcher","Seann William Scott","Jennifer Garner","Marla Sokoloff","Kristy Swanson"],"backdrop_path":"https://image.tmdb.org/t/p/original/xrziJc1RpB5ZI0FYvm4ALxZ6Hi2.jpg","poster_path":"https://image.tmdb.org/t/p/original/l1YxKBtIpPRS1kCX46mnKtwFkuE.jpg","certification":"12","genres":["Comédia","Romance","Ficção científica"],"trailer":"N/A"},
