"1107387":{"id":"1107387","name":"Hachiko Para Sempre","slug":"hachiko-para-sempre","original_title":"忠犬八公","overview":"A produção traz uma adaptação do roteiro original de “Hachiko Monogatari”, que apresenta a história de um cachorro da raça Akita Inu, que mesmo depois da morte de seu dono continuou a esperá-lo por dez anos na estação de trem de Shibuya, em Tóquio. No longa, um professor encontra um filhote abandonado em uma cidade distante e desabitada e decide adotá-lo. A dupla cria um forte laço de amizade e afeto a ponto do cão acompanhar seu dono até a estação todos os dias. No entanto, quando o professor morre, o companheiro passa a esperá-lo no mesmo lugar apesar da família decidir deixar a cidade.","first_air_date":"2023-03-31","runtime":124,"episode_run_time":[124],"vote_average":7.9,"created_by":["iQIYI Pictures","Beijing Lajin Film"],"production_companies":[{"name":"iQIYI Pictures"},{"name":"Beijing Lajin Film"}],"cast":["冯小刚","Joan Chen","白举纲","Huang Chutong","钱波"],"backdrop_path":"https://image.tmdb.org/t/p/original/sptxlzXJA1t1oWrtAv3t88cKkB2.jpg","poster_path":"https://image.tmdb.org/t/p/original/w5GeWMEEWJBMKXSeDB5BpcowEBn.jpg","certification":"L","genres":["Drama","Família"],"trailer":"Sc1-vKwoH4Q"},
