"9876":{"id":"9876","name":"Pare! Senão Mamãe Atira","slug":"pare-senao-mamae-atira","original_title":"Stop! Or My Mom Will Shoot","overview":"Em Los Angeles Joe Bromowski, um detetive da polícia, há pouco tempo rompeu o relacionamento que tinha com Gwen Harper, sua namorada e também sua chefe no departamento de polícia. Assim Tutti, sua mãe, decide que está na hora de lhe fazer uma visita. Tutti transforma a vida de Joe em algo deprimente quando começa a criticar sua roupa, limpar seu apartamento e até mesmo lavar sua arma. Tutti participa de investigações e de alguma maneira se envolve com uma organização que comercializa armas ilegalmente e na qual a polícia tenta se infiltrar. Além disto, trata Joe como uma criança e, para seu desespero, ela não pode sair da cidade, pois testemunhou um crime.","first_air_date":"1992-02-21","runtime":87,"episode_run_time":[87],"vote_average":5.3,"created_by":["Universal Pictures","Northern Lights Entertainment"],"production_companies":[{"name":"Universal Pictures"},{"name":"Northern Lights Entertainment"}],"cast":["Sylvester Stallone","Estelle Getty","JoBeth Williams","Roger Rees","Martin Ferrero"],"backdrop_path":"https://image.tmdb.org/t/p/original/qR4KkhkFXoYkLAFHtQesLFLTsN4.jpg","poster_path":"https://image.tmdb.org/t/p/original/yrXGOipP4EKTRrqyVvohTAkKUQj.jpg","certification":"N/A","genres":["Ação","Comédia"],"trailer":"N/A"},
