"1039960":{"id":"1039960","name":"Monster High 2","slug":"monster-high-2","original_title":"Monster High 2","overview":"O filme segue Clawdeen Wolf (Miia Harris), Draculaura (Naya Damasen) e Frankie Stein (Ceci Balagot) em seu segundo ano em Monster High. O poder das três amigas é posto à prova enquanto elas enfrentam desafios em um novo ano: novos alunos, novos poderes, amizades em evolução e uma ameaça ainda maior que pode não apenas romper a amizade, mas mudar o mundo para sempre. O filme também apresentará a nova personagem Toralei (Salena Qureshi), uma mulher-gato mal-humorada, que retorna após um ano no exterior em Scaris, França.","first_air_date":"2023-10-05","runtime":94,"episode_run_time":[94],"vote_average":6.9,"created_by":["Mattel Television","Lighthouse Pictures","Nickelodeon Productions","Brightlight Pictures","Mattel"],"production_companies":[{"name":"Mattel Television"},{"name":"Lighthouse Pictures"},{"name":"Nickelodeon Productions"},{"name":"Brightlight Pictures"},{"name":"Mattel"}],"cast":["Miia Harris","Nayah Damasen","Ceci Balagot","Case Walker","Justin Derickson"],"backdrop_path":"https://image.tmdb.org/t/p/original/1CbExVP0bgrTshP7DvnDdwqryYL.jpg","poster_path":"https://image.tmdb.org/t/p/original/mClrCMfGpOqTSiuCTSK67WZ92x5.jpg","certification":"L","genres":["Fantasia","Ficção científica","Ação","Aventura"],"trailer":"VeheAu6TfC0"},
"5550":{"id":"5550","name":"RoboCop 3","slug":"robocop-3","original_title":"RoboCop 3","overview":"A corporação OCP estuda desenvolver o projeto Delta City, que vai substituir a abandonada cidade de Detroit. Para atingir este fim, a OCP convoca as forças armadas para intimidar os residentes de fora da cidade, sob o pretexto de que eles estarão contribuindo sua parte para reduzir a criminalidade. Depois de Robocop se unir à resistência civil, ele sustenta vários ferimentos, mas se recupera para lutar contra os robôs-ninja construídos pela OCP.","first_air_date":"1993-01-21","runtime":104,"episode_run_time":[104],"vote_average":4.8,"created_by":["Orion Pictures","Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Orion Pictures"},{"name":"Metro-Goldwyn-Mayer"}],"cast":["Robert John Burke","Nancy Allen","Rip Torn","John Castle","Jill Hennessy"],"backdrop_path":"https://image.tmdb.org/t/p/original/hA4JZRL35vO4ez4UGUGUg9QlMwU.jpg","poster_path":"https://image.tmdb.org/t/p/original/ppLSSwCuC5ERRWbu9H3R8SPL9AM.jpg","certification":"N/A","genres":["Ação","Aventura","Crime","Ficção científica","Thriller"],"trailer":"N/A"},
"43266":{"id":"43266","name":"Como Era Verde o Meu Vale","slug":"como-era-verde-o-meu-vale","original_title":"How Green Was My Valley","overview":"Aos 60 anos, Huw Morgan relembra sua vida quando garoto (Roddy McDowall) em uma pequena cidade mineradora. Suas reminiscências revelam a desintegração da unida família Morgan e de seus dedicados pais (Donald Crisp e Sara Allgood), enquanto capta os sentimentos e problemas daquele tempo. Maureen O’Hara e Walter Pidgeon co-estrelam este aclamado clássico das telas nesta história sobre sonhos, lutas e triunfos de uma família.","first_air_date":"1941-10-28","runtime":119,"episode_run_time":[119],"vote_average":7.3,"created_by":["20th Century Fox"],"production_companies":[{"name":"20th Century Fox"}],"cast":["Walter Pidgeon","Maureen O'Hara","Anna Lee","Donald Crisp","Roddy McDowall"],"backdrop_path":"https://image.tmdb.org/t/p/original/ucQESsrG63LsA5HD70aaPxEyORk.jpg","poster_path":"https://image.tmdb.org/t/p/original/1D2linQi2VWojXn7SkHyKxT1z3m.jpg","certification":"Livre","genres":["Drama"],"trailer":"N/A"},
