"11009":{"id":"11009","name":"Os Embalos de Sábado à Noite","slug":"os-embalos-de-sabado-a-noite","original_title":"Saturday Night Fever","overview":"Tony Manero, um jovem do Brooklyn e um excelente dançarino de disco music, só encontra significado na vida quando dança, pois passar a semana trabalhando em uma loja de tintas não o gratifica de forma nenhuma. Assim ele se perfuma, se veste de um jeito fashion e vai para a discoteca no final de semana. Sob a influência de seu irmão, um padre frustrado, e de Stephanie, sua parceira de dança, começa a questionar a maneira como encara a vida e a limitação de suas perspectivas. Paralelamente Tony vive uma crise amorosa, enquanto se prepara para participar de um concurso em uma discoteca.","first_air_date":"1977-12-16","runtime":118,"episode_run_time":[118],"vote_average":6.7,"created_by":["Robert Stigwood Organization","Paramount Pictures","SNF Productions"],"production_companies":[{"name":"Robert Stigwood Organization"},{"name":"Paramount Pictures"},{"name":"SNF Productions"}],"cast":["John Travolta","Karen Lynn Gorney","Barry Miller","Joseph Cali","Paul Pape"],"backdrop_path":"https://image.tmdb.org/t/p/original/iihMna17sTxP3zwlWBsKZbvDiGZ.jpg","poster_path":"https://image.tmdb.org/t/p/original/A3izZZs3rB6qdsAooxCxvSj42aj.jpg","certification":"16","genres":["Música","Drama"],"trailer":"N/A"},
