"269":{"id":"269","name":"Acossado","slug":"acossado","original_title":"À bout de souffle","overview":"Após roubar um carro em Marselha, Michel Poiccard (Jean-Paul Belmondo) ruma para Paris. No caminho mata um policial, que tentou prendê-lo por excesso de velocidade, e em Paris persuade a relutante Patricia Franchisi (Jean Seberg), uma estudante americana com quem se envolveu, para escondê-lo até receber o dinheiro que lhe devem. Michel promete a Patricia que irão juntos para a Itália. No entanto, o crime de Michel está nos jornais e agora não há opção. Ele fica escondido no apartamento de Patricia, onde conversam, namoram, ele fala sobre a morte e ela diz que quer ficar grávida dele. Ele perde a consciência da situação na qual se encontra e anda pela cidade cometendo pequenos delitos, mas quando é visto por um informante começa o final da sua trágica perseguição.","first_air_date":"1960-03-16","runtime":90,"episode_run_time":[90],"vote_average":7.5,"created_by":["Les Films Impéria","Les Productions Georges de Beauregard","SNC"],"production_companies":[{"name":"Les Films Impéria"},{"name":"Les Productions Georges de Beauregard"},{"name":"SNC"}],"cast":["Jean-Paul Belmondo","Jean Seberg","Daniel Boulanger","Henri-Jacques Huet","Roger Hanin"],"backdrop_path":"https://image.tmdb.org/t/p/original/4WGuyWf1f94CsEeVIIqDKGw5rmO.jpg","poster_path":"https://image.tmdb.org/t/p/original/duTBwrPiJV75xGSzq1Xe68UCrdw.jpg","certification":"N/A","genres":["Drama","Crime"],"trailer":"N/A"},
