"37950":{"id":"37950","name":"A Morte e Vida de Charlie","slug":"a-morte-e-vida-de-charlie","original_title":"Charlie St. Cloud","overview":"Adorado pela mãe e pelo irmãozinho Sam, Charlie St. Cloud é um velejador de sucesso e universitário com um futuro brilhante. Quando Sam morre em um um terrível acidente, os sonhos de Charlie também morrem. Mas a ligação entre os dois irmãos é tão forte que, todo entardecer, eles se encontram. A volta de uma ex-colega de escola obriga Charlie a tomar uma decisão difícil: permanecer preso ao passado ou deixar que o amor lhe mostre o futuro.","first_air_date":"2010-07-30","runtime":99,"episode_run_time":[99],"vote_average":7.0,"created_by":["Marc Platt Productions","Universal Pictures","Relativity Media"],"production_companies":[{"name":"Marc Platt Productions"},{"name":"Universal Pictures"},{"name":"Relativity Media"}],"cast":["Zac Efron","Charlie Tahan","Amanda Crew","Augustus Prew","Donal Logue"],"backdrop_path":"https://image.tmdb.org/t/p/original/dzx5vStQX4bHA1JBq8n5yLUqQx4.jpg","poster_path":"https://image.tmdb.org/t/p/original/jvdcrtVBHaaYchjdGzVyDdiLRnh.jpg","certification":"12","genres":["Drama","Romance"],"trailer":"i68-U5z8bnA"},
"1024621":{"id":"1024621","name":"Meu Nome é Chihiro","slug":"meu-nome-e-chihiro","original_title":"ちひろさん","overview":"Em Meu Nome é Chihiro, escrito e dirigido por Rikiya Imaizumi (By the Window) Chihiro trabalhava como prostituta, até que passou por uma cidade litorânea e ali comeu uma porção de bento, que gostou tanto que decidiu fixar-se lá e trabalhar na loja de bentôs. Agora recebe os clientes com um sorriso na loja de bento e conversa com eles, sem qualquer vergonha ou interesse em esconder o seu passado. Chihiro conversa com os clientes sobre vários problemas e, por meio de suas conversas, os conforta. Embora ela mesma sofra de solidão, que começou com sua família quando ela era pequena, quando ela conhece um novo cliente, ela também a usa para enfrentar sua solidão e superá-la aos poucos.","first_air_date":"2023-02-23","runtime":131,"episode_run_time":[131],"vote_average":7.1,"created_by":["Asmik Ace","Digital Frontier","Netflix"],"production_companies":[{"name":"Asmik Ace"},{"name":"Digital Frontier"},{"name":"Netflix"}],"cast":["Kasumi Arimura","豊嶋花","若葉竜也","佐久間由衣","Van"],"backdrop_path":"https://image.tmdb.org/t/p/original/xOlEdqLMwf1OakIC1sokact3Piq.jpg","poster_path":"https://image.tmdb.org/t/p/original/hkvq6vqz6j1gSojBYkpTjSauFZD.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
