"20533":{"id":"20533","name":"Jonah Hex: Caçador de Recompensas","slug":"jonah-hex-cacador-de-recompensas","original_title":"Jonah Hex","overview":"Saido dos quadrinhos e das graphics novels, o legendário Jonah Hex, um caçador de recompensas andarilho marcado por seu rosto desfigurado, um atirador durão e cínico que consegue localizar qualquer pessoa e qualquer coisa. Além de ter escapado da morte, Jonah tem uma história de vida violenta, cheia de mitos e lendas que o deixaram com um pé no mundo real e outro no \"outro lado\". Sua única ligação dentre os humanos é Leila, cuja vida em bordéis também lhe deixou cicatrizes profundas. Mas o passado de Jonah está prestes a alcançá-lo quando o exército americano lhe faz uma proposta irrecusável: em troca de anistia, ele precisa encontrar e deter o perigoso terrorista Quentin Turnbull. Turnbull, que está reunindo um exército e se preparando para abrir as portas do inferno, também é o mais antigo inimigo de Jonah e não vai parar até vê-lo morto.","first_air_date":"2010-06-18","runtime":81,"episode_run_time":[81],"vote_average":4.9,"created_by":["Warner Bros. Pictures","Legendary Pictures","Weed Road Pictures","Mad Chance","DC"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"Legendary Pictures"},{"name":"Weed Road Pictures"},{"name":"Mad Chance"},{"name":"DC"}],"cast":["Josh Brolin","John Malkovich","Megan Fox","Michael Fassbender","Will Arnett"],"backdrop_path":"https://image.tmdb.org/t/p/original/bivJNU5gUzVQeyXYDfntxVYWenw.jpg","poster_path":"https://image.tmdb.org/t/p/original/ageBP5EWpmdGKJmp0RhsNDIDRh5.jpg","certification":"14","genres":["Ação","Faroeste","Drama","Fantasia","Thriller"],"trailer":"N/A"},
