"492":{"id":"492","name":"Quero Ser John Malkovich","slug":"quero-ser-john-malkovich","original_title":"Being John Malkovich","overview":"Um homem (John Cusack) consegue um novo emprego no 7º ½ andar de um edifício comercial, onde todos os funcionários devem andar curvados. Lá encontra uma porta, escondida, que leva quem ultrapassá-la até a mente do ator John Malkovich, onde pode permanecer durante 15 minutos, até ser cuspido numa estrada na saída de Nova Jersey. Impressionado com a descoberta, resolve alugar a passagem para outras pessoas, dentre elas o próprio John Malkovich.","first_air_date":"1999-10-29","runtime":113,"episode_run_time":[113],"vote_average":7.4,"created_by":["Propaganda Films","Single Cell Pictures","Gramercy Pictures"],"production_companies":[{"name":"Propaganda Films"},{"name":"Single Cell Pictures"},{"name":"Gramercy Pictures"}],"cast":["John Cusack","John Malkovich","Cameron Diaz","Catherine Keener","Orson Bean"],"backdrop_path":"https://image.tmdb.org/t/p/original/1Nyjb7aeRKynWgmOl8he5ZcvWLm.jpg","poster_path":"https://image.tmdb.org/t/p/original/rFpKAnc9X01sucqFPiD9pzxLpiA.jpg","certification":"18","genres":["Comédia","Drama","Fantasia"],"trailer":"N/A"},
"9437":{"id":"9437","name":"Beijos Que Matam","slug":"beijos-que-matam","original_title":"Kiss the Girls","overview":"Um psicólogo forense (Morgan Freeman) de Washington viaja até a Carolina do Norte para investigar o aparente sequestro de sua sobrinha, que desapareceu do campus universitário em meio a outros sequestros similares. Ele está praticamente certo que as jovens vítimas dos recentes sequestros estão vivas, pois quem está executando estes raptos é um \"colecionador\". No entanto, ele não sabe se sua sobrinha está entre as possíveis vítimas, mas consegue ser ajudado por uma médica (Ashley Judd) que estava no cativeiro, conseguiu escapar e garante que várias jovens estão vivas, inclusive quem ele procura. O investigador decide então caçar o sequestrador, que usa o pseudônimo de \"Casanova\".","first_air_date":"1997-09-29","runtime":116,"episode_run_time":[116],"vote_average":6.5,"created_by":["Paramount Pictures","Rysher Entertainment","David Brown Productions"],"production_companies":[{"name":"Paramount Pictures"},{"name":"Rysher Entertainment"},{"name":"David Brown Productions"}],"cast":["Morgan Freeman","Ashley Judd","Cary Elwes","Alex McArthur","Tony Goldwyn"],"backdrop_path":"https://image.tmdb.org/t/p/original/y319VH0gIFie6KEO5L4nHhxxQUw.jpg","poster_path":"https://image.tmdb.org/t/p/original/f9sNoZ1boYqIrIgHKblBPnus9ez.jpg","certification":"N/A","genres":["Thriller","Crime","Mistério","Drama"],"trailer":"N/A"},
"169209":{"id":"169209","name":"O Grande Assalto","slug":"o-grande-assalto","original_title":"Empire State","overview":"Chris Potamitis sonha em trabalhar como policial, mas como não consegue passar na prova de admissão, acaba aceitando um pequeno emprego como segurança do icónico Empire State Building. Quando descobre que a segurança do local é cheia de falhas, ele e um amigo, Eddie planejam um roubo milionário nos cofres do edifício. Mas ambos enfrentam dois problemas pelo caminho: a presença de uma máfia local, que já pretendia executar um plano semelhante, e a vigilância de um policial linha dura, que espia as ações dos dois.","first_air_date":"2013-09-03","runtime":94,"episode_run_time":[94],"vote_average":5.4,"created_by":["Knightsbridge Entertainment","Grindstone Entertainment Group","EFO Films","Kind Hearts Entertainment"],"production_companies":[{"name":"Knightsbridge Entertainment"},{"name":"Grindstone Entertainment Group"},{"name":"EFO Films"},{"name":"Kind Hearts Entertainment"}],"cast":["Liam Hemsworth","Dwayne Johnson","Emma Roberts","Nikki Reed","Michael Angarano"],"backdrop_path":"https://image.tmdb.org/t/p/original/mESAhF5QvbtPxEAiqlwP3qwKV3Z.jpg","poster_path":"https://image.tmdb.org/t/p/original/ydLRZlP2YAAnxBf3Hy6GcpXVRck.jpg","certification":"14","genres":["Ação","Drama"],"trailer":"N/A"},
