"25676":{"id":"25676","name":"Três Ladrões e um Bebê","slug":"tres-ladroes-e-um-bebe","original_title":"寶貝計劃","overview":"Para o compulsivo jogador de Slipper existe apenas uma coisa mais aterrorizante do que os credores — o som do choro de um bebê. Mas e se um bebê se transforma-se no salvador de suas dívidas? Sua fobia por fraldas, mamadeiras e canções de ninar desapareceria? Essa oportunidade surge quando, junto com seu senhorio e o oportunista Octopus, seqüestra BB, o neto de um magnata. Mas sem saber, eles frustram os planos da tríade. Assim que descobrem que a tríade está no seu encalço, eles, com a ajuda da doce enfermeira Melody, da esposa do senhorio louco por bebês e Pat Yin, fã adolescente de Octopus. Slipper resolve transformar o bebê refém em seu protegido. Encurralados pelos policiais e perseguidos por gângsteres perigosos, este trio embarca numa arrepiante, perigosa e delirantemente engraçada fuga para colocar BB de volta em seu berço são e salvo.","first_air_date":"2006-09-28","runtime":135,"episode_run_time":[135],"vote_average":7.0,"created_by":["JCE Movies","China Film Co-Production Corp.","Huayi Brothers Pictures"],"production_companies":[{"name":"JCE Movies"},{"name":"China Film Co-Production Corp."},{"name":"Huayi Brothers Pictures"}],"cast":["Jackie Chan","古天樂","許冠文","蔡卓妍","元彪"],"backdrop_path":"https://image.tmdb.org/t/p/original/vdbLewJrL6zf1FBezpFHihS6r6G.jpg","poster_path":"https://image.tmdb.org/t/p/original/1jIi7Y8q2cERMfebWWjfGuh9IqF.jpg","certification":"N/A","genres":["Drama","Ação","Comédia"],"trailer":"N/A"},
