"22897":{"id":"22897","name":"Simplesmente Complicado","slug":"simplesmente-complicado","original_title":"It's Complicated","overview":"Santa Barbara. Jane é mãe de três filhos e mantém uma relação amigável com Jake, seu ex-marido, de quem se separou há dez anos. Quando eles se encontram para a formatura de um dos filhos, fora da cidade, surge um clima e eles passam a ter um caso. Só que Jake é agora casado com Agness, o que faz com que Jane torne-se sua amante. Paralelamente, Adam entra na vida de Jane. Ele é um arquiteto contratado para remodelar a cozinha do restaurante de Jane e, aos poucos, se apaixona por ela.","first_air_date":"2009-12-23","runtime":121,"episode_run_time":[121],"vote_average":6.5,"created_by":["Universal Pictures","Relativity Media","Waverly Films","Scott Rudin Productions","dentsu"],"production_companies":[{"name":"Universal Pictures"},{"name":"Relativity Media"},{"name":"Waverly Films"},{"name":"Scott Rudin Productions"},{"name":"dentsu"}],"cast":["Meryl Streep","Alec Baldwin","Steve Martin","John Krasinski","Caitlin FitzGerald"],"backdrop_path":"https://image.tmdb.org/t/p/original/xhvqM3MJc3ubtOztN5Ioo8WS88B.jpg","poster_path":"https://image.tmdb.org/t/p/original/bw4WvmEJ0AeOvPTVSY0hZqjoEM4.jpg","certification":"14","genres":["Comédia","Romance"],"trailer":"N/A"},
"398173":{"id":"398173","name":"A Casa Que Jack Construiu","slug":"a-casa-que-jack-construiu","original_title":"The House That Jack Built","overview":"Um dia, durante um encontro fortuito na estrada, o arquiteto Jack mata uma mulher. Este evento provoca um prazer inesperado no personagem, que passa a assassinar dezenas de pessoas ao longo de doze anos. Devido ao descaso das autoridades e à indiferença dos habitantes locais, o criminoso não encontra dificuldade em planejar seus crimes, executá-los ao olhar de todos e guardar os cadáveres num grande frigorífico. Tempos mais tarde, ele compartilha os seus casos mais marcantes com o sábio Virgílio numa jornada rumo ao inferno.","first_air_date":"2018-07-05","runtime":151,"episode_run_time":[151],"vote_average":7.1,"created_by":["Zentropa Entertainments","Copenhagen Film Fund","Copenhagen Film Fund","Slot Machine","Film i Väst","Zentropa International Sweden","Zentropa International France","Zentropa International Köln"],"production_companies":[{"name":"Zentropa Entertainments"},{"name":"Copenhagen Film Fund"},{"name":"Copenhagen Film Fund"},{"name":"Slot Machine"},{"name":"Film i Väst"},{"name":"Zentropa International Sweden"},{"name":"Zentropa International France"},{"name":"Zentropa International Köln"}],"cast":["Matt Dillon","Bruno Ganz","Uma Thurman","Siobhan Fallon Hogan","Sofie Gråbøl"],"backdrop_path":"https://image.tmdb.org/t/p/original/1UAjYFLLQYOzFd0Ud6YQq2HoubU.jpg","poster_path":"https://image.tmdb.org/t/p/original/oKG4YJJCoXJSZ89J52CNJwmVKS0.jpg","certification":"18","genres":["Drama","Terror","Crime","Thriller"],"trailer":"N/A"},
