"10592":{"id":"10592","name":"A Guerra de Hart","slug":"a-guerra-de-hart","original_title":"Hart's War","overview":"Tommy Hart (Colin Farrell) é um estudante do 2º ano de Direito que se alista no exército para lutar pelos Aliados na 2ª Guerra Mundial. Em meio a guerra ele acaba sendo capturado, sendo posteriormente enviado a um campo de concentração. Lá um soldado negro é acusado de ter assassinado um soldado branco que era racista, sendo que ambos eram prisioneiros no local. Ao invés de executá-lo, os nazistas concordam com o plano apresentado pelo coronel William McNamara (Bruce Willis), também prisioneiro no campo, que propõe que o soldado acusado tenha um julgamento realizado no local. Hart é então designado a defender o soldado acusado enquanto que McNamara usa a situação para empreender seu plano de fuga do local.","first_air_date":"2002-02-15","runtime":125,"episode_run_time":[125],"vote_average":6.4,"created_by":["David Foster Productions","Cheyenne Enterprises","David Ladd Films","Metro-Goldwyn-Mayer"],"production_companies":[{"name":"David Foster Productions"},{"name":"Cheyenne Enterprises"},{"name":"David Ladd Films"},{"name":"Metro-Goldwyn-Mayer"}],"cast":["Colin Farrell","Bruce Willis","Terrence Howard","Marcel Iureș","Cole Hauser"],"backdrop_path":"https://image.tmdb.org/t/p/original/z9BwMdHqKhVhRi2s5BcihGiqWWZ.jpg","poster_path":"https://image.tmdb.org/t/p/original/hePkUbOc3d0uV6Nt576Hvs9m8kK.jpg","certification":"N/A","genres":["Drama","Guerra"],"trailer":"N/A"},
