"4959":{"id":"4959","name":"Trama Internacional","slug":"trama-internacional","original_title":"The International","overview":"Em Trama Internacional, um suspense arrebatador, Louis Salinger (Clive Owen), agente da Interpol e Eleanor Whitman (Naomi Watts), Promotora de Justiça de Manhattan, estão decididos a levar um dos bancos mais poderosos do mundo à justiça. Revelando inúmeras atividades ilegais repreensíveis, Salinger e Whitman rastreiam o dinheiro de Berlim a Milão, de Nova York a Istambul. Ao correrem grandes riscos pelo mundo, sua tenacidade implacável põe suas próprias vidas em jogo, já que nada detém seus alvos - nem assassinatos, de continuar a financiar o terror e a guerra.","first_air_date":"2009-02-03","runtime":118,"episode_run_time":[118],"vote_average":6.2,"created_by":["Studio Babelsberg","Atlas Entertainment","Mosaic Media Group","X Filme Creative Pool","Columbia Pictures"],"production_companies":[{"name":"Studio Babelsberg"},{"name":"Atlas Entertainment"},{"name":"Mosaic Media Group"},{"name":"X Filme Creative Pool"},{"name":"Columbia Pictures"}],"cast":["Clive Owen","Naomi Watts","Armin Mueller-Stahl","Ulrich Thomsen","Brían F. O'Byrne"],"backdrop_path":"https://image.tmdb.org/t/p/original/fTM8ZJL23nvFLshLUN3SdSrTFsi.jpg","poster_path":"https://image.tmdb.org/t/p/original/babtd7ZFX77b2xkr7XR2fiJBGzV.jpg","certification":"14","genres":["Ação","Thriller","Drama","Crime","Aventura","Mistério"],"trailer":"KzMxMArYctE"},
"10757":{"id":"10757","name":"O Amor dos Pais","slug":"o-amor-dos-pais","original_title":"कभी ख़ुशी कभी ग़म","overview":"O melhor filme indiano de 2001, é um drama familiar, onde o conflito de gerações, honra de família, o amor de mãe e filho são os principais ingredientes que tornaram este filme num verdadeiro sucesso. Com interpretações de grandes nomes do atual cinema indiano, tais como Amitabh Bachchan, Shahrukh Khan, Kajol, Hrithik Roshan, Kareena Kapoor e Jaya Bhaduri, este filme tem uma maravilhosa trilha sonora,companhada de excelentes coreografias.","first_air_date":"2001-12-14","runtime":210,"episode_run_time":[210],"vote_average":7.7,"created_by":["Dharma Productions","Yash Raj Films","British Film Commission","K3G Films Limited"],"production_companies":[{"name":"Dharma Productions"},{"name":"Yash Raj Films"},{"name":"British Film Commission"},{"name":"K3G Films Limited"}],"cast":["Amitabh Bachchan","शाहरुख़ ख़ान","Hrithik Roshan","Kajol","Jaya Bachchan"],"backdrop_path":"https://image.tmdb.org/t/p/original/42vFebJ0VRnwdemaUOIr7c6Tjo1.jpg","poster_path":"https://image.tmdb.org/t/p/original/d0ikAxHFUeLOfF4iGwIjMFgoWrP.jpg","certification":"N/A","genres":["Comédia","Drama"],"trailer":"N/A"},
"12187":{"id":"12187","name":"Morrendo e Aprendendo","slug":"morrendo-e-aprendendo","original_title":"Heart and Souls","overview":"São Francisco, 1959. Um distraído motorista de ônibus, Hal, provoca um acidente no qual ele e mais quatro passageiros morrem: Harrison, Penny, Julia e Milo. Apesar de o causador do acidente ter ido diretamente para o Céu, o mesmo não aconteceu com as outras vítimas porque no exato momento do acidente nascia uma criança chamada Thomas, em um carro próximo ao local. Por essa razão, as quatro almas ficaram ligadas de alguma forma ao pequenino, que passou a ser o único que podia vê-los e ainda interagir com eles. Conforme o tempo foi passando, eles começaram a acreditar que estariam atrapalhando o crescimento do menino e decidiram sumir de sua vida dele. Anos mais tarde, o motorista retorna à Terra para levar as almas dos passageiros. É quando eles descobrem que o objetivo de terem ficado era para concluir coisas inacabadas de sua vidas, abreviadas pelo acidente.","first_air_date":"1993-08-13","runtime":104,"episode_run_time":[104],"vote_average":6.9,"created_by":["Alphaville Films","Stampede Entertainment","Universal Pictures"],"production_companies":[{"name":"Alphaville Films"},{"name":"Stampede Entertainment"},{"name":"Universal Pictures"}],"cast":["Robert Downey Jr.","Charles Grodin","Alfre Woodard","Kyra Sedgwick","Tom Sizemore"],"backdrop_path":"https://image.tmdb.org/t/p/original/orjpvbnfiDQvqRJIy9cLAb8WTgF.jpg","poster_path":"https://image.tmdb.org/t/p/original/gSqaYO4MO57nLZqnod4N2BWV02Q.jpg","certification":"N/A","genres":["Fantasia","Comédia","Romance"],"trailer":"N/A"},
