"8390":{"id":"8390","name":"Três Vezes Amor","slug":"tres-vezes-amor","original_title":"Definitely, Maybe","overview":"Will Hayes, um trintão de Manhattan, está no meio do processo de seu divórcio quando sua filha lhe pergunta sobre sua vida antes do casamento, incluindo como conheceu a sua mãe. Will regressa a 1992 e fala de três mulheres, alterando seus nomes de modo que sua filha deva adivinhar qual delas tornou-se sua esposa.","first_air_date":"2008-02-08","runtime":111,"episode_run_time":[111],"vote_average":6.9,"created_by":["Ringerike Erste Filmproduktion","Universal Pictures","StudioCanal","Working Title Films"],"production_companies":[{"name":"Ringerike Erste Filmproduktion"},{"name":"Universal Pictures"},{"name":"StudioCanal"},{"name":"Working Title Films"}],"cast":["Ryan Reynolds","Abigail Breslin","Elizabeth Banks","Isla Fisher","Rachel Weisz"],"backdrop_path":"https://image.tmdb.org/t/p/original/wid86tR3KvQ8SBzjmlcXMTSRXsy.jpg","poster_path":"https://image.tmdb.org/t/p/original/ylkTvkyJ5gG3unwRsgFBlkgX93v.jpg","certification":"12","genres":["Comédia","Romance"],"trailer":"N/A"},
"9315":{"id":"9315","name":"Plano de Voo","slug":"plano-de-voo","original_title":"Flightplan","overview":"Kyle Pratt é uma mulher devastada emocionalmente, devido à recente morte súbita de seu marido. Em meio a uma viagem de Berlim a Nova York, estando a mais de 40 mil pés de atitude e a bordo de um moderno avião, Kyle entra em pânico após perceber o desaparecimento de sua filha de 6 anos, Julia. Desesperada, Kyle precisa provar à tripulação e aos passageiros sua sanidade, já que não há pista alguma sobre o paradeiro de Julia, e ao mesmo tempo convencer a si mesmo que não está enlouquecendo.","first_air_date":"2005-09-22","runtime":98,"episode_run_time":[98],"vote_average":6.5,"created_by":["Touchstone Pictures","Imagine Entertainment"],"production_companies":[{"name":"Touchstone Pictures"},{"name":"Imagine Entertainment"}],"cast":["Jodie Foster","Peter Sarsgaard","Erika Christensen","Kate Beahan","Greta Scacchi"],"backdrop_path":"https://image.tmdb.org/t/p/original/kIURbUuwykR9F0yCCpCTCxfJSR0.jpg","poster_path":"https://image.tmdb.org/t/p/original/pmiuoYVyV1YxxZ1EjwIuHIgtXPt.jpg","certification":"N/A","genres":["Thriller","Drama","Mistério"],"trailer":"N/A"},
