"81446":{"id":"81446","name":"Os Fora da Lei","slug":"os-fora-da-lei","original_title":"The Baytown Outlaws","overview":"Após receber três tiros de seu ex-marido Carlos (Billy Bob Thornton), Celeste (Eva Longoria) resolve contratar três irmãos fora da lei para que tragam para ela seu afilhado Rob (Thomas Brodie-Sangster). Entretanto, nem tudo será tão simples assim. O que a princípio aparentava ser um mero resgate banal logo se torna uma grande batalha, já que os irmãos precisam enfrentar agentes federais, caçadores índios e ainda belas assassinas.","first_air_date":"2012-08-27","runtime":98,"episode_run_time":[98],"vote_average":6.0,"created_by":["Lleju Productions","State Street Pictures"],"production_companies":[{"name":"Lleju Productions"},{"name":"State Street Pictures"}],"cast":["Clayne Crawford","Travis Fimmel","Daniel Cudmore","Thomas Brodie-Sangster","Andre Braugher"],"backdrop_path":"https://image.tmdb.org/t/p/original/fynGPtLcobYqBIPTeKIxW8tNvjo.jpg","poster_path":"https://image.tmdb.org/t/p/original/sCjLpFUP21rPZY2hjbTwCHDDvPb.jpg","certification":"N/A","genres":["Ação","Comédia","Crime"],"trailer":"N/A"},
"501907":{"id":"501907","name":"Um Lindo Dia na Vizinhança","slug":"um-lindo-dia-na-vizinhanca","original_title":"A Beautiful Day in the Neighborhood","overview":"Fred Rogers foi o criador de Mister Rogers' Neighborhood, um programa infantil de TV muito popular na década de 1960. Em 1998, Tom Junod, até então um cínico jornalista, aceitou escrever o perfil de Rogers para a revista Esquire. Durante as entrevistas para a materia, Junod mudou não só sua visão em relação ao seu entrevistado como também sua visão de mundo, iniciando uma inspiradora amizade com o apresentador.","first_air_date":"2019-09-07","runtime":107,"episode_run_time":[107],"vote_average":7.0,"created_by":["TriStar Pictures","Tencent Pictures","Big Beach"],"production_companies":[{"name":"TriStar Pictures"},{"name":"Tencent Pictures"},{"name":"Big Beach"}],"cast":["Matthew Rhys","Tom Hanks","Chris Cooper","Susan Kelechi Watson","Maryann Plunkett"],"backdrop_path":"https://image.tmdb.org/t/p/original/cSJMk9Jar8SibFXL8JAF9p2fhKu.jpg","poster_path":"https://image.tmdb.org/t/p/original/qenbW0aWvW8bxNb0XVDPeIUwFVu.jpg","certification":"12","genres":["Drama","História"],"trailer":"FoZaiNUUfmU"},
"958196":{"id":"958196","name":"Dentro","slug":"dentro","original_title":"Inside","overview":"Em seu território, ninguém chega aos pés de Nemo (Willem Dafoe). O ladrão profissional se especializou em roubo de arte e é considerado um verdadeiro gênio na indústria. Um dia, outro golpe é iminente: junto com seus cúmplices, ele quer roubar um renomado colecionador de suas obras. Mas assim que ele invade a luxuosa cobertura, algo completamente inesperado acontece: o sofisticado sistema de segurança do apartamento bloqueia todas as saídas e entradas e depois desmorona. Nemo agora está sozinho e, acima de tudo, preso.","first_air_date":"2023-03-09","runtime":105,"episode_run_time":[105],"vote_average":5.6,"created_by":["A Private View","Heretic","Schiwago Film","MMC Movies","E.R.T.","BNP Paribas Fortis"],"production_companies":[{"name":"A Private View"},{"name":"Heretic"},{"name":"Schiwago Film"},{"name":"MMC Movies"},{"name":"E.R.T."},{"name":"BNP Paribas Fortis"}],"cast":["Willem Dafoe","Gene Bervoets","Eliza Stuyck","Andrew Blumenthal","Vincent Eaton"],"backdrop_path":"https://image.tmdb.org/t/p/original/5deKXeVmu3G8821gV8DtKHmRd6r.jpg","poster_path":"https://image.tmdb.org/t/p/original/yQjcYCFfBLRQvnvkHy5rbHMUewH.jpg","certification":"N/A","genres":["Thriller","Drama"],"trailer":"N/A"},
