"597890":{"id":"597890","name":"Viajantes - Instinto e Desejo","slug":"viajantes-instinto-e-desejo","original_title":"Voyagers","overview":"Um grupo de jovens é enviado ao espaço numa missão para povoar um planeta recém descoberto. Depois que o capitão da missão é misteriosamente morto, a jovem tripulação vai ao caos, revertendo para um estado primitivo, tribal, e cedendo aos seus desejos mais selvagens.","first_air_date":"2021-04-08","runtime":108,"episode_run_time":[108],"vote_average":6.0,"created_by":["Nota Bene","Thunder Road"],"production_companies":[{"name":"Nota Bene"},{"name":"Thunder Road"}],"cast":["Tye Sheridan","Lily-Rose Depp","Fionn Whitehead","Colin Farrell","Chanté Adams"],"backdrop_path":"https://image.tmdb.org/t/p/original/9dBSwftCzkC4K4zgMZTwcm58VUR.jpg","poster_path":"https://image.tmdb.org/t/p/original/50mYEEOiueKarAhlHAz5qOTuIzX.jpg","certification":"14","genres":["Ficção científica","Thriller"],"trailer":"z59YLMWgzqk"},
