"975773":{"id":"975773","name":"Pequenas Cartas Obscenas","slug":"pequenas-cartas-obscenas","original_title":"Wicked Little Letters","overview":"Uma cidade litorânea inglesa da década de 1920 é testemunha de um escândalo sombrio e absurdo nessa comédia de mistério alucinante. Baseado em uma história verídica mais estranha que a ficção, que acompanha duas vizinhas: a profundamente conservadora Edith Swan e a desordeira imigrante irlandesa Rose Gooding. Quando Edith e outros moradores começam a receber cartas perversas, cheias de palavrões involuntariamente hilários, a desbocada Rose é acusada do crime. As cartas anônimas provocam um alvoroço nacional e um julgamento se segue. No entanto, quando as mulheres da cidade - lideradas pela policial Gladys Moss - começam a investigar o crime, elas suspeitam que algo está errado e que Rose pode não ser a culpada.","first_air_date":"2024-02-23","runtime":100,"episode_run_time":[100],"vote_average":7.0,"created_by":["Blueprint Pictures","South of the River Pictures","Film4 Productions","People Person Pictures","StudioCanal"],"production_companies":[{"name":"Blueprint Pictures"},{"name":"South of the River Pictures"},{"name":"Film4 Productions"},{"name":"People Person Pictures"},{"name":"StudioCanal"}],"cast":["Olivia Colman","Jessie Buckley","Anjana Vasan","Timothy Spall","Gemma Jones"],"backdrop_path":"https://image.tmdb.org/t/p/original/2Q8WtoX8Ojn4YjDaGc0TzmR20wk.jpg","poster_path":"https://image.tmdb.org/t/p/original/lxplNecJQ0aKQEYLaZsz6ucbwko.jpg","certification":"N/A","genres":["Comédia","Drama","Mistério"],"trailer":"1kzN2yEXo1E"},
