"59861":{"id":"59861","name":"Larry Crowne: O Amor Está de Volta","slug":"larry-crowne-o-amor-esta-de-volta","original_title":"Larry Crowne","overview":"Larry Crowne (Tom Hanks) trabalha há anos em uma loja, onde já foi escolhido por nove vezes como o funcionário do mês. Um dia, para sua surpresa, ele é demitido por não ter curso superior. Precisando recomeçar do zero, ele resolve se matricular na faculdade. Um dos cursos que realiza é o de oratório, ministrado por Mercedes Tainot (Julia Roberts), que está desanimada devido ao desinteresse dos alunos por sua matéria. A vida na faculdade faz com que Larry ganhe novos amigos, mude seu estilo de vida e se aproxime, cada vez mais, de Mercedes.","first_air_date":"2011-06-30","runtime":98,"episode_run_time":[98],"vote_average":6.0,"created_by":["Vendôme Pictures","Playtone"],"production_companies":[{"name":"Vendôme Pictures"},{"name":"Playtone"}],"cast":["Tom Hanks","Julia Roberts","Bryan Cranston","Cedric the Entertainer","Pam Grier"],"backdrop_path":"https://image.tmdb.org/t/p/original/hl5twrpQBa1VhpsaLFphByGUGt.jpg","poster_path":"https://image.tmdb.org/t/p/original/rB2H98T6xiOsc6KrtDjXbIWoOWy.jpg","certification":"10","genres":["Comédia","Romance","Drama"],"trailer":"N/A"},
"4551":{"id":"4551","name":"Be Cool: O Outro Nome do Jogo","slug":"be-cool-o-outro-nome-do-jogo","original_title":"Be Cool","overview":"Chili Palmer (John Travolta) decide abandonar suas atividades na indústria cinematográfica para se dedicar à outra arte: a música. Após um de seus amigos ser eliminado enquanto com ele almoçava, Chili decide procurar a esposa dele, Edie (Uma Thurman), para lhe oferecer uma parceria em uma nova gravadora independente. Chili descobriu uma promissora artista pop, Linda Moon (Christina Milian), mas precisa lidar com Raji (Vince Vaughn), o empresário de Linda, e ainda com Elliot Wilhelm (Dwayne Johnson), o namorado dela que é também aspirante a ator. Chili precisa ainda se envolver com mafiosos russos e Sin LaSalle (Cedric the Entertainer), um produtor de rap, para manter sua recém-aberta gravadora em funcionamento.","first_air_date":"2005-03-04","runtime":118,"episode_run_time":[118],"vote_average":5.5,"created_by":["Metro-Goldwyn-Mayer","Jersey Films","Double Feature Films"],"production_companies":[{"name":"Metro-Goldwyn-Mayer"},{"name":"Jersey Films"},{"name":"Double Feature Films"}],"cast":["John Travolta","Uma Thurman","Vince Vaughn","Cedric the Entertainer","Dwayne Johnson"],"backdrop_path":"https://image.tmdb.org/t/p/original/rAx0aCQ6luULuUb8tW6CD1365Mh.jpg","poster_path":"https://image.tmdb.org/t/p/original/7M7Vkzfm5sOm8arcp8CkZLssDkW.jpg","certification":"N/A","genres":["Comédia","Crime"],"trailer":"N/A"},
